  [],\n\t\"revision_timestamp\": \"2016-02-26T22:14:30.339696\",\n\t\"name\": \"environmental-working-group-joint-u-s-russian-atlas-of-the-arctic-ocean-e2d44\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Environmental Working Group (EWG) was
  established in June 1995 under the framework of the U.S.-Russian Joint Commission
  on Economic and Technological Cooperation. In January 1996, the EWG Arctic Climatology
  Group took on the task of compiling digital data on arctic regions to expand scientific
  understanding of the Arctic. This work resulted in a set of three atlases on arctic
  oceanography, sea ice, and meteorology. These atlases are distributed via FTP.The
  Environmental Working Group Joint U.S.-Russian Atlas of the Arctic Ocean was developed
  by specialists from the Environmental Research Institute of Michigan with Russian
  and U.S. partners. The Atlas consist of separate volumes for winter and summer,
  with the following file names G01961a and G01961b respectively. More than 1.3 million
  individual temperature and salinity observations collected from Russian and western
  drifting stations, ice breakers, and airborne expeditions were used to develop the
  products contained in the winter volume.The primary products of the Atlas are gridded
  mean fields for decadal periods (1950s,1960s, 1970s, 1980s) of temperature, salinity,
  density and dynamic height, Atlantic water layer depth, and temperature and salinity
  profiles and transects. The original individual observations that were used to derive
  these fields are not provided with the Atlas and are not available.Note that the
  Polar Science Center Hydrographic Climatology (PHC) ocean database (version 3.0)
  is available from the Polar Science Center, Applied Physics Laboratory, University
  of Washington. This is a global gridded database with a high quality description
  of arctic seas achieved by merging data from several sources, including data from
  the Environmental Working Group Joint U.S.-Russian Atlas of the Arctic Ocean.  The
  PHC or later versions may be more suitable for your research. Inquires may be sent
  to: Michael Steele, Applied Physics Laboratory, 1013 NE 40th Street, Seattle, WA
  98105\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
